Verenigde Staten
Komedie / Fantasy
98 minuten

een goeie lach film

met Tim Allen, Robert Downey Jr. en Kristin Davis

Advocaat Dave Douglas (Tim Allen) heeft nauwelijks tijd voor zijn vrouw en kinderen, aangezien hij druk bezig is met een zaak 
rondom een geheimzinnig dierenlaboratorium. Als zijn dochter uit protest tegen de experimenten in het laboratorium een 300 jaar 
oude hond uit Tibet mee naar huis neemt, wordt haar vader door deze hond gebeten. Deze beet zorgt ervoor dat Dave's lichaam uit 
het niets in een hond veranderd. Zo krijgt Dave letterlijk een andere kijk op zichzelf, maar ook op zijn gezin. Hij ontdekt dat 
hij een betere vader wil worden, maar moet eerst zo snel mogelijk Dr. Kozak ontmaskeren.:
